// HomePage.js
import styled from 'styled-components';

import EpicButton from '../StyledComponentsApp/EpicButton';

const BodyContainer = styled.div`
    width: 100%;
    height: 50%;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
`;

const HomePage = () => {
    return (
        <BodyContainer>
            <EpicButton registration={true}>Регистрация</EpicButton>
            <EpicButton>Войти</EpicButton>
        </BodyContainer>
    );
};

export default HomePage;
